<p class="font_7" style="font-size:16px;"><span class="wixGuard"> </span></p>

<p class="font_7" style="font-size:16px;"><span style="font-size:16px;"><span style="font-family:raleway,sans-serif;">Zalozyciel zespolu Soul City, z kt&oacute;rym dotarl do cwiercfinalu II edycji X Factor. Reprezentowal Polske wraz z Monika Wisniowska-Basel na&nbsp;festiwalu &quot;New Wave&quot; - najwiekszego rosyjskiego festiwalu mlodych talent&oacute;w (Jurmala, Lotwa, 2011 r.).</span></span></p>

<p class="font_7" style="font-size:16px;"><span class="wixGuard"> </span></p>

<p class="font_7" style="font-size:16px;"><span style="font-size:16px;"><span style="font-family:raleway,sans-serif;">Na swoim koncie ma koncerty&nbsp;na terenie calego kraju i za granica (Rosja, Ukraina, Niemcy, Hiszpania, Wlochy, Lotwa). Inicjator koncertu wsp&oacute;lczesnych utwor&oacute;w rosyjskich, kt&oacute;ry po raz pierwszy odbyl sie w 2007 roku we Wroclawiu.</span></span></p>

<p class="font_7" style="font-size:16px;"><span style="font-size:16px;"><span style="font-family:raleway,sans-serif;"><span class="wixGuard"> </span></span></span></p>

<p class="font_7" style="font-size:16px;"><span style="font-size:16px;"><span style="font-family:raleway,sans-serif;">Czlonek Opole Gospel Choir w latach 2002-2017. </span></span></p>

<p class="font_7" style="font-size:16px;">&nbsp;</p>

<p class="font_7" style="font-size:16px;"><span style="font-size:16px;"><span style="font-family:raleway,sans-serif;">W roku 2018 powstaly projekty muzyczne &quot;Zaucha Project&quot; i &quot;Pamieci Zbigniewa&quot;. Od stycznia 2019 roku prowadzi cykl koncert&oacute;w we wroclawskim klubie Vertigo pt. &quot;Historia Franka Sinatry&quot;.</span></span></p>

<p class="font_7" style="font-size:16px;"><span style="font-size:16px;"><span style="font-family:raleway,sans-serif;"><span class="wixGuard"> </span></span></span></p>

<p class="font_7" style="font-size:16px;"><span style="font-size:16px;"><span style="font-family:raleway,sans-serif;">Pochodzi z Opola. Obecnie mieszka i tworzy we Wroclawiu.</span></span></p></div><div style="min-width:280px;max-width:500px;min-height:575px;max-height:2000px;top:;bottom:;left:;right:;width:329px;height:575px;position:" class="FacebookLikeBox_1" id="comp-jsge9sru"><div class="fb-page" data-href="http://www.facebook.com/michalbobermusic" data-height="575" data-width="329" data-hide-cover="false" data-show-posts="true" data-show-facepile="true" data-adapt-container-width="true"></div></div><div style="height:277px;width:480px;top:;bottom:;left:;right:;position:" class="v1" id="comp-jsgdvpgh"><div tabindex="0" id="comp-jsgdvpghvideoFrame" class="v1videoFrame"><iframe height="100%" width="100%" allowfullscreen="" frameBorder="0" title="External YouTube" aria-label="External YouTube" data-src="//www.youtube.com/embed/pZlFNLyZUy8?wmode=transparent&amp;autoplay=0&amp;theme=dark&amp;controls=1&amp;autohide=1&amp;loop=0&amp;showinfo=0&amp;rel=0&amp;playlist=false&amp;enablejsapi=0"></iframe></div><div style="display:none" id="comp-jsgdvpghpreview" class="v1preview"></div></div><div style="height:277px;width:480px;top:;bottom:;left:;right:;position:" class="v1" id="comp-jsgdw07m"><div tabindex="0" id="comp-jsgdw07mvideoFrame" class="v1videoFrame"><iframe height="100%" width="100%" allowfullscreen="" frameBorder="0" title="External YouTube" aria-label="External YouTube" data-src="//www.youtube.com/embed/eB27lPoWvVs?wmode=transparent&amp;autoplay=0&amp;theme=dark&amp;controls=1&amp;autohide=1&amp;loop=0&amp;showinfo=0&amp;rel=0&amp;playlist=false&amp;enablejsapi=0"></iframe></div><div style="display:none" id="comp-jsgdw07mpreview" class="v1preview"></div></div><div style="height:277px;width:480px;top:;bottom:;left:;right:;position:" class="v1" id="comp-jsgdwkz2"><div tabindex="0" id="comp-jsgdwkz2videoFrame" class="v1videoFrame"><iframe height="100%" width="100